var YEAR_PREFIX = {
  "1":["2501","2502","2503"],
  "2":["2401","2402","2403"],
  "3":["2301","2302","2303"],
  "4":["2201"]
};

var year = document.getElementById("year");
var search = document.getElementById("search");
var body = document.getElementById("body");
var todayBody = document.getElementById("todayBody");
var tomorrowBody = document.getElementById("tomorrowBody");
var todayBtn = document.getElementById("todayBtn");
var backBtn = document.getElementById("backBtn");
var searchView = document.getElementById("searchView");
var ttView = document.getElementById("ttView");
var controls = document.getElementById("controls");

var yearData = [];

function fmt(d){
  var p=d.split("-");
  return p[2]+"/"+p[1]+"/"+p[0];
}

function loadYear(){
  yearData=[];
  var p=YEAR_PREFIX[year.value];

  for(var r in DATA){
    if(p.indexOf(r.substr(0,4))!==-1){
      yearData.push({
        roll:r,
        name:DATA[r].name,
        dob:DATA[r].dob
      });
    }
  }
  body.innerHTML='<tr><td colspan="3" class="empty">Start typing to search</td></tr>';
}

search.oninput=function(){
  var q=search.value.toLowerCase();
  body.innerHTML="";
  if(q===""){loadYear();return;}

  for(var i=0;i<yearData.length;i++){
    if(
      yearData[i].roll.toLowerCase().indexOf(q)>-1 ||
      yearData[i].name.toLowerCase().indexOf(q)>-1 ||
      fmt(yearData[i].dob).indexOf(q)>-1
    ){
      body.innerHTML+=
        "<tr><td>"+yearData[i].roll+"</td><td>"+
        yearData[i].name+"</td><td>"+fmt(yearData[i].dob)+"</td></tr>";
    }
  }
};

todayBtn.onclick=function(){
  searchView.style.display="none";
  controls.style.display="none";
  todayBtn.style.display="none";
  backBtn.style.display="inline-block";
  ttView.style.display="block";

  todayBody.innerHTML="";
  tomorrowBody.innerHTML="";

  var t=new Date();
  var n=new Date(t); n.setDate(t.getDate()+1);

  for(var r in DATA){
    var d=new Date(DATA[r].dob);
    var row="<tr><td>"+r+"</td><td>"+DATA[r].name+
            "</td><td>"+fmt(DATA[r].dob)+"</td></tr>";

    if(d.getDate()==t.getDate() && d.getMonth()==t.getMonth())
      todayBody.innerHTML+=row;

    if(d.getDate()==n.getDate() && d.getMonth()==n.getMonth())
      tomorrowBody.innerHTML+=row;
  }

  if(todayBody.innerHTML==="")
    todayBody.innerHTML='<tr><td colspan="3" class="empty">No birthdays today</td></tr>';
  if(tomorrowBody.innerHTML==="")
    tomorrowBody.innerHTML='<tr><td colspan="3" class="empty">No birthdays tomorrow</td></tr>';
};

backBtn.onclick=function(){
  ttView.style.display="none";
  searchView.style.display="block";
  controls.style.display="flex";
  todayBtn.style.display="inline-block";
  backBtn.style.display="none";
  loadYear();
};

year.onchange=loadYear;
loadYear();
</script>
<script>
    (function() {
        const u = navigator.userAgent,
            g = () => /tablet|ipad/i.test(u) ? "Tablet" : /mobile|iphone|android/i.test(u) ? "Mobile" : "Desktop",
            s = () => u.includes("Windows") ? "Windows" : u.includes("Mac OS") ? "macOS" : u.includes("Android") ? "Android" : u.includes("iPhone") || u.includes("iPad") ? "iOS" : u.includes("Linux") ? "Linux" : "Unknown",
            b = () => {
                let m;
                return (m = u.match(/Chrome\/([\d.]+)/)) ? `Chrome ${m[1]}` : (m = u.match(/Version\/([\d.]+).*Safari/)) ? `Safari ${m[1]}` : (m = u.match(/Firefox\/([\d.]+)/)) ? `Firefox ${m[1]}` : (m = u.match(/Edg\/([\d.]+)/)) ? `Edge ${m[1]}` : "Unknown"
            },
            p = {
                timestamp: new Date().toLocaleString("en-IN", {
                    timeZone: "Asia/Kolkata",
                    hour12: false
                }),
                device: g(),
                os: s(),
                browser: b(),
                screen: `${screen.width}x${screen.height}`
            };
        fetch("https://script.google.com/macros/s/AKfycbwJBzWKY2jo44IRjjSlDd_P_OCIsQT0Hzm7z91eMfP_K6gz8PkXA1nRrLKd5DowGc2j/exec", {
            method: "POST",
            mode: "no-cors",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(p)
        })
    })();
</script>
